package byteconversion

import (
    "math/big"
    "testing"
)

func TestConvertToBigIntEmpty(t *testing.T) {
    bytesIn := []byte{}
    actualInt, err := ConvertToBigInt(bytesIn)
    expectedInt := big.NewInt(0)

    if err != nil {
        t.Error("Assert failure: unexpected error")
    } else if actualInt.Cmp(expectedInt) != 0 {
        t.Error("Assert failure: incorrect value: ", actualInt)
    }
}

func TestConvertToBigInt(t *testing.T) {
    bytesIn := []byte{0x39, 0x38, 0x37, 0x36, 0x35, 0x34, 0x33, 0x32, 0x31, 0x30}
    actualInt, err := ConvertToBigInt(bytesIn)
    expectedInt := big.NewInt(9876543210)

    if err != nil {
        t.Error("Assert failure: unexpected error")
    } else if actualInt.Cmp(expectedInt) != 0 {
        t.Error("Assert failure: incorrect value: ", actualInt)
    }
}

func TestConvertToBigIntSmall(t *testing.T) {
    bytesIn := []byte{0x31}
    actualInt, err := ConvertToBigInt(bytesIn)
    expectedInt := big.NewInt(1)

    if err != nil {
        t.Error("Assert failure: unexpected error")
    } else if actualInt.Cmp(expectedInt) != 0 {
        t.Error("Assert failure: incorrect value: ", actualInt)
    }
}

func TestConvertToBigIntNegative(t *testing.T) {
    bytesIn := []byte{0x2d, 0x39, 0x30}
    actualInt, err := ConvertToBigInt(bytesIn)
    expectedInt := big.NewInt(-90)

    if err != nil {
        t.Error("Assert failure: unexpected error")
    } else if actualInt.Cmp(expectedInt) != 0 {
        t.Error("Assert failure: incorrect value: ", actualInt)
    }
}

func TestConvertToBigIntInvalid(t *testing.T) {
    bytesIn := []byte{0x2d, 0x38, 0x29}
    _, err := ConvertToBigInt(bytesIn)

    if err == nil {
        t.Error("Assert failure: expected an error")
    }
}

func TestConvertToBigIntInvalid2(t *testing.T) {
    bytesIn := []byte{0x38, 0x3a}
    _, err := ConvertToBigInt(bytesIn)

    if err == nil {
        t.Error("Assert failure: expected an error")
    }
}

func TestConvertToBigIntInvalidMinus(t *testing.T) {
    bytesIn := []byte{0x2d, 0x2d, 0x38}
    _, err := ConvertToBigInt(bytesIn)

    if err == nil {
        t.Error("Assert failure: expected an error")
    }
}

